import React, { useState, useEffect } from "react";
import style from "./summary.module.css";
import Images from "../images/Images";
import Info from "../info/Info";
import Person from "../person/Person";
import Reports from "../reports/Reports";

function Summary() {
  const [data, setData] = useState({});

  useEffect(() => {
    fetch("http://localhost:8000/api/data")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  }, []);

 return (
   <div className={`container ${style["size78"]}`}>
     <div className="row">
       <div className={`col-md-3`}>
         <div className={`${style["card-like"]} ${style["size645"]}`}>
           <Person {...data} />
         </div>
         <div className={style["another-component"]}>
           {/* קומפוננטה נוספת שאינה חלק מהכרטיס */}
           <AnotherComponent />
         </div>
       </div>
       <div className={`col-md-6 ${style["card-like"]} ${style["size4"]}`}>
         <Info summary={data.summary} scan={data.scan} />
       </div>
       <div className={`col-md-2 ${style["card-like"]}  ${style["size2"]}`}>
         <Images images={data.secondaryImages} />
       </div>
     </div>
   </div>
 );
}
export default Summary;
